void rozetka_check_material(uint16_t face)
{
	uint16_t mat,i,n_faces;
	char flg;
	GLfloat params[4];

	for(mat=0;mat<Num_rozetka_materials;mat++)
	{
		n_faces=rozetka_materials[mat].start_faces_length;
		flg=0;
		if(n_faces)
		{
			for(i=0;i<n_faces;i++)
			{
				if(rozetka_materials[mat].start_faces[i]==face) flg=1;
			}
		}
		if(flg)    // Select material
		{
			params[0]=rozetka_materials[mat].Ka[0];
			params[1]=rozetka_materials[mat].Ka[1];
			params[2]=rozetka_materials[mat].Ka[2];
			params[3]=rozetka_materials[mat].Ka_alpha;
			glMaterialfv (GL_FRONT_AND_BACK,GL_AMBIENT,params);
			params[0]=rozetka_materials[mat].Kd[0];
			params[1]=rozetka_materials[mat].Kd[1];
			params[2]=rozetka_materials[mat].Kd[2];
			params[3]=rozetka_materials[mat].Kd_alpha;
			glMaterialfv (GL_FRONT_AND_BACK,GL_DIFFUSE,params);
			params[0]=rozetka_materials[mat].Ks[0];
			params[1]=rozetka_materials[mat].Ks[1];
			params[2]=rozetka_materials[mat].Ks[2];
			params[3]=rozetka_materials[mat].Ks_alpha;
			glMaterialfv (GL_FRONT_AND_BACK,GL_SPECULAR,params);
			glMaterialf (GL_FRONT_AND_BACK,GL_SHININESS,rozetka_materials[mat].Ns);
			rozetka_bind_texture(mat);
		}
	}
}

GLint rozetka_generate_list()
{
	uint16_t i,j;
	int32_t ind;
	GLint list;

	rozetka_materials_init();
	list=glGenLists(1);
	glNewList(list,GL_COMPILE);
	for(i=0;i<Num_rozetka_faces;i++)
	{
	rozetka_check_material(i);
	glBegin(GL_TRIANGLES);
		for(j=0;j<3;j++)
		{
			ind=rozetka_faces[i][j][1]-1;
			if(ind>0)glTexCoord2f(rozetka_texcoords[ind][0],rozetka_texcoords[ind][1]);
			ind=rozetka_faces[i][j][2]-1;
			glNormal3f(rozetka_normals[ind][0],rozetka_normals[ind][1],rozetka_normals[ind][2]);
			ind=rozetka_faces[i][j][0]-1;
			glVertex3f(rozetka_vertex[ind][0],rozetka_vertex[ind][1],rozetka_vertex[ind][2]);
		}
		glEnd();
	}
	glEndList();
	return list;
}
